(559, 1, '2010-05-09 07:51:54', '2010-05-09 14:51:54', '“I never tried to prove nothing, just wanted to give a good show. My life has always been my music, it''s always come first, but the music ain''t worth nothing if you can''t lay it on the public. The main thing is to live for that audience, ''cause what you''re there for is to please the people.”', 'Post Format: Aside', '', 'publish', 'closed', 'closed', '', 'post-format-aside', '', '', '2010-05-09 07:51:54', '2010-05-09 14:51:54', '', 0, 'http://wpthemetestdata.wordpress.com/?p=559', 0, 'post', '', 0),
(562, 1, '2010-01-08 07:59:31', '2010-01-08 14:59:31', 'Abbott: Strange as it may seem, they give ball players nowadays very peculiar names.\n\nCostello: Funny names?\n\nAbbott: Nicknames, nicknames. Now, on the St. Louis team we have Who''s on first, What''s on second, I Don''t Know is on third--\n\nCostello: That''s what I want to find out. I want you to tell me the names of the fellows on the St. Louis team.\n\nAbbott: I''m telling you. Who''s on first, What''s on second, I Don''t Know is on third--\n\nCostello: You know the fellows'' names?\n\nAbbott: Yes.\n\nCostello: Well, then who''s playing first?\n\nAbbott: Yes.\n\nCostello: I mean the fellow''s name on first base.\n\nAbbott: Who.\n\nCostello: The fellow playin'' first base.\n\nAbbott: Who.\n\nCostello: The guy on first base.\n\nAbbott: Who is on first.\n\nCostello: Well, what are you askin'' me for?\n\nAbbott: I''m not asking you--I''m telling you. Who is on first.\n\nCostello: I''m asking you--who''s on first?\n\nAbbott: That''s the man''s name.\n\nCostello: That''s who''s name?\n\nAbbott: Yes.\n\nCostello: When you pay off the first baseman every month, who gets the money?\n\nAbbott: Every dollar of it. And why not, the man''s entitled to it.\n\nCostello: Who is?\n\nAbbott: Yes.\n\nCostello: So who gets it?\n\nAbbott: Why shouldn''t he? Sometimes his wife comes down and collects it.\n\nCostello: Who''s wife?\n\nAbbott: Yes. After all, the man earns it.\n\nCostello: Who does?\n\nAbbott: Absolutely.\n\nCostello: Well, all I''m trying to find out is what''s the guy''s name on first base?\n\nAbbott: Oh, no, no. What is on second base.\n\nCostello: I''m not asking you who''s on second.\n\nAbbott: Who''s on first!\n\nCostello: St. Louis has a good outfield?\n\nAbbott: Oh, absolutely.\n\nCostello: The left fielder''s name?\n\nAbbott: Why.\n\nCostello: I don''t know, I just thought I''d ask.\n\nAbbott: Well, I just thought I''d tell you.\n\nCostello: Then tell me who''s playing left field?\n\nAbbott: Who''s playing first.\n\nCostello: Stay out of the infield! The left fielder''s name?\n\nAbbott: Why.\n\nCostello: Because.\n\nAbbott: Oh, he''s center field.\n\nCostello: Wait a minute. You got a pitcher on this team?\n\nAbbott: Wouldn''t this be a fine team without a pitcher?\n\nCostello: Tell me the pitcher''s name.\n\nAbbott: Tomorrow.\n\nCostello: Now, when the guy at bat bunts the ball--me being a good catcher--I want to throw the guy out at first base, so I pick up the ball and throw it to who?\n\nAbbott: Now, that''s he first thing you''ve said right.\n\nCostello: I DON''T EVEN KNOW WHAT I''M TALKING ABOUT!\n\nAbbott: Don''t get excited. Take it easy.\n\nCostello: I throw the ball to first base, whoever it is grabs the ball, so the guy runs to second. Who picks up the ball and throws it to what. What throws it to I don''t know. I don''t know throws it back to tomorrow--a triple play.\n\nAbbott: Yeah, it could be.\n\nCostello: Another guy gets up and it''s a long ball to center.\n\nAbbott: Because.\n\nCostello: Why? I don''t know. And I don''t care.\n\nAbbott: What was that?\n\nCostello: I said, I DON''T CARE!\n\nAbbott: Oh, that''s our shortstop!', 'Post Format: Chat', '', 'publish', 'closed', 'closed', '', 'post-format-chat', '', '', '2010-01-08 07:59:31', '2010-01-08 14:59:31', '', 0, 'http://wpthemetestdata.wordpress.com/?p=562', 0, 'post', '', 0),
