(191, '_transient_dash_f69de0bbfe7eaa113146875f40c02000', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/02/wordpress-4-4-2-security-and-maintenance-release/''>WordPress 4.4.2 Security and Maintenance Release</a> <span class="rss-date">02.02.2016</span><div class="rssSummary">WordPress 4.4.2 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.4.1 and earlier are affected by two security issues: a possible SSRF for certain local URIs, reported by Ronni Skansing; and an open redirection attack, reported by Shailesh Suthar. Thank you [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://ma.tt/2016/02/lent-this-year-buying-things/''>Matt: Lent This Year: Buying Things</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/learn-how-to-test-wordpress-core-patches-with-vvv-on-mac-os''>WPTavern: Learn How to Test WordPress Core Patches with VVV on Mac OS</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/automattic-launches-components-with-5-new-starter-themes-based-on-underscores''>WPTavern: Automattic Launches Components with 5 New Starter Themes Based on Underscores</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Популярный плагин:</span> <a href=''https://wordpress.org/plugins/wpclef/'' class=''dashboard-news-plugin-link''>Clef Two-Factor Authentication</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=wpclef&amp;_wpnonce=41de430d19&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Clef Two-Factor Authentication''>Установить</a>)</span></li></ul></div>', 'no'),
